webpackJsonp([43415470123144],{1239:function(a,t){a.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/flash-camp-birmingham/index.md absPath of file >>> MarkdownRemark",html:'<p><a href="http://flashcamp.co.uk/" target="_blank"><img class="alignnone size-full wp-image-871" title="Flash Camp - Birmingham" src="http://uploads.psyked.co.uk/2009/05/flashcampbirmingham.jpg" alt="Flash Camp - Birmingham" width="500" height="280"></a></p>\n<p><strong>Flash Camp Birmingham</strong> is now open for registrations - it\'s on June 16th (2009), 12pm - 8pm.</p>\n<p>It\'s gonna be great, of course - is organised by the <a href="http://flashmidlands.com/" target="_blank">Flash Midlands user group</a>, and is the first FlashCamp to take place in the UK outside of London.  Luckily for all who are used to everything taking place in London, Birmingham is only a single train ride from London. ;-)</p>\n<p>There\'s quite a few interesting presentations arranged for the day: <a href="http://flashcamp.co.uk/schedule.html">http://flashcamp.co.uk/schedule.html</a> and plenty of information on how to get there: <a href="http://flashcamp.co.uk/venue.html">http://flashcamp.co.uk/venue.html</a></p>\n<p>Head on over to the website to register, and turn up on the day! (It\'s free!)</p>',frontmatter:{title:"Flash Camp Birmingham",date:"May 07, 2009",tags:["flash"]}}},pathContext:{}}}});
